import React, { useState } from "react";

import MainText from "../components/Homepage/MainText";

import leaf from "../images/plant.png";
import styles from "./Homepage.module.css";

const Homepage = () => {
  return (
    <div className={styles.container}>
      <MainText className={styles.container__text} />
      <div className={styles.container__blur}></div>
      <img src={leaf} className={styles.container__img}></img>
    </div>
  );
};

export default Homepage;
